Есть субсидии на объекты от застройщика:
• от 12 млн ₽ — для Москвы, МО, Санкт-Петербурга и ЛО;
• от 6 млн ₽ — для других регионов

Ставки при покупке у первого собственника дома с участком не старше 2 лет:
• 11,3% — если подтвердить доход;
• 11,8% — если не подтверждать доход

Скидки на ставки — все суммируются:
• 0,2% — если закладная в электронном виде;
• 0,2% — если банк финансирует строительство объекта;
• 0,5% — если дом строят с домокомплектом

Скидки на ставки — все суммируются:
• 0,2% — если закладная в электронном виде;
• 0,2% — если банк финансирует строительство объекта

Подходит, если стаж работы заёмщика:
• Больше 2 лет, на последнем месте — 3 месяца;
• Больше 1 года, на последнем месте — полгода;
• 1 год, если это первое место работы.

Минимальная сумма кредита:
• 600 000 ₽ — на объект в Москве, МО, Санкт-Петербурге и ЛО;
• 300 000 ₽ — на объект в другом регионе

Ставка ниже, если оплатить комиссию:
• на 0,5% — за 1% от кредита;
• на 1% — за 2,5% от кредита.

